PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "bot_employee" ("first_name" varchar(40) NOT NULL, "last_name" varchar(40) NOT NULL, "middle_name" varchar(40) NOT NULL, "fio" varchar(45) NOT NULL, "bsuir_id" bigint NOT NULL PRIMARY KEY);
CREATE TABLE IF NOT EXISTS "bot_studentgroup" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(7) NOT NULL UNIQUE, "course" smallint NULL);
CREATE TABLE IF NOT EXISTS "bot_lesson" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "weekday" smallint NOT NULL, "weeks" integer NOT NULL, "subgroup" smallint NOT NULL, "auditory" varchar(12) NULL, "lesson_time" varchar(11) NOT NULL, "lesson_start" time NOT NULL, "lesson_end" time NOT NULL, "lesson_type" varchar(6) NOT NULL, "subject" varchar(20) NOT NULL, "zaoch" bool NOT NULL, "employee_id" bigint NULL REFERENCES "bot_employee" ("bsuir_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "bot_lesson_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "lesson_id" bigint NOT NULL REFERENCES "bot_lesson" ("id") DEFERRABLE INITIALLY DEFERRED, "studentgroup_id" bigint NOT NULL REFERENCES "bot_studentgroup" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "bot_grouplead" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" bigint NOT NULL UNIQUE REFERENCES "bot_studentgroup" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NULL UNIQUE REFERENCES "bot_scheduleuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "bot_chat" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "chat_id" bigint unsigned NOT NULL UNIQUE CHECK ("chat_id" >= 0), "state" bigint unsigned NOT NULL CHECK ("state" >= 0), "authorised" bool NOT NULL, "connected_user_id" bigint NULL REFERENCES "bot_scheduleuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "bot_scheduleuser" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "username" varchar(32) NOT NULL UNIQUE, "first_name" varchar(32) NOT NULL, "last_name" varchar(32) NOT NULL, "is_member" bool NOT NULL, "is_active" bool NOT NULL, "is_admin" bool NOT NULL, "group_id" bigint NULL REFERENCES "bot_studentgroup" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action_time" datetime NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "bot_scheduleuser" ("id") DEFERRABLE INITIALLY DEFERRED, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0));
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
DELETE FROM sqlite_sequence;
CREATE INDEX "bot_lesson_employee_id_1df80211" ON "bot_lesson" ("employee_id");
CREATE UNIQUE INDEX "bot_lesson_groups_lesson_id_studentgroup_id_a1005399_uniq" ON "bot_lesson_groups" ("lesson_id", "studentgroup_id");
CREATE INDEX "bot_lesson_groups_lesson_id_0e11e597" ON "bot_lesson_groups" ("lesson_id");
CREATE INDEX "bot_lesson_groups_studentgroup_id_3aa77519" ON "bot_lesson_groups" ("studentgroup_id");
CREATE INDEX "bot_chat_connected_user_id_2d32fac1" ON "bot_chat" ("connected_user_id");
CREATE INDEX "bot_scheduleuser_group_id_9c7a7b1d" ON "bot_scheduleuser" ("group_id");
CREATE INDEX "django_admin_log_content_type_id_c4bce8eb" ON "django_admin_log" ("content_type_id");
CREATE INDEX "django_admin_log_user_id_c564eba6" ON "django_admin_log" ("user_id");
CREATE UNIQUE INDEX "django_content_type_app_label_model_76bd3d3b_uniq" ON "django_content_type" ("app_label", "model");
CREATE UNIQUE INDEX "auth_group_permissions_group_id_permission_id_0cd325b0_uniq" ON "auth_group_permissions" ("group_id", "permission_id");
CREATE INDEX "auth_group_permissions_group_id_b120cbf9" ON "auth_group_permissions" ("group_id");
CREATE INDEX "auth_group_permissions_permission_id_84c5c92e" ON "auth_group_permissions" ("permission_id");
CREATE UNIQUE INDEX "auth_permission_content_type_id_codename_01ab375a_uniq" ON "auth_permission" ("content_type_id", "codename");
CREATE INDEX "auth_permission_content_type_id_2f476e4b" ON "auth_permission" ("content_type_id");
CREATE INDEX "django_session_expire_date_a5c62663" ON "django_session" ("expire_date");
COMMIT;
